import React, { useState } from 'react';
import {
  Navbar as RNavbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,

  NavbarText,
} from 'reactstrap';

function CustomNavbar(args) {

  return (
    <RNavbar {...args}>
      <NavbarBrand href="/">reactstrap</NavbarBrand>
    </RNavbar>
  );
}

export default CustomNavbar;
